export default class DataManager {
  getElections() {
    return [
      { id: 0, name: "2022 Presedential Election", color: "#134989" },
      { id: 1, name: "2022 Presedential Election", color: "#071f4a" },
      { id: 2, name: "2022 Presedential Election", color: "#44a5e4" },
      { id: 3, name: "2022 Presedential Election", color: "#a7e1f3" },
    ];
  }
}
